svg.script:
    frame = 40;
	direction = 1;
    function doOneStep() {
	rondvert = document.getElementById("Speech_bubble");
	rondvert.setAttribute("opacity", frame/100); /* L'opacité varie de 1.0 à 0.0 */
	icons = document.getElementById("sky");
	icons.setAttribute("y", 300+frame);
	frame += (direction)? 1 : -1;
	console.log(frame);
	if ((frame <= 100) && (frame >= 20)){
	    setTimeout(doOneStep, 40);
    } else {
	direction = 1 - direction;
	console.log(direction);
	setTimeout(doOneStep, 100);
	}
	}
	
    doOneStep(); /* démarre l'animation */
